def format_size(bytes_):

    suffixes = ['B', 'KiB', 'MiB', 'GiB', 'TiB', 'PiB', 'EiB']

    index = 0
    start = 1
    while bytes_ >= start * 1024:
        start *= 1024
        index += 1

    return "%.2f %s" % (bytes_ / start, suffixes[index])

