def ellipse_perimeter(maj_ax, min_ax):

    # https://www.universoformulas.com/matematicas/geometria/perimetro-elipse/
    import math
    H = ((maj_ax - min_ax)/(maj_ax + min_ax))**2
    return math.pi*(maj_ax + min_ax)*(1 + 3*H/(10 + (4 - 3*H)**.5))

