import pytest

def format_duration(duration):
    if duration > 100:
        raise ValueError("Duration must be less than or equal to 100.")
    hours = duration // 60
    minutes = duration % 60
    return f"{hours}:{minutes:02d}"

def test_format_duration_with_hours():
    assert format_duration(60) == "1:00"

def test_format_duration_with_minutes():
    assert format_duration(1) == "0:01"

def test_format_duration_with_hours_and_minutes():
    assert format_duration(123) == "2:03"

