def NumToBase(x, base):

  # Right to left order.
  digits = []
  while x > 0:
    digits.append(x % base)
    x //= base
  if len(digits) == 0:
    digits.append(0)
  # Reverse the digits so they are left to right.
  return digits[::-1]

