def hexStringToRGB(hex):

    temp = hex
    length = len(hex)
    if temp[0] == "#":
        temp = hex[1:length]
    if not len(temp) == 6:
        return None
    colorArr = bytearray.fromhex(temp)
    return colorArr[0], colorArr[1], colorArr[2]

